import React, { useState, useEffect } from 'react';

function PincodeLocation() {
    const [locationData, setLocationData] = useState(null);

    const fetchLocationData = async (pincode) => {
        const apiUrl = `https://nominatim.openstreetmap.org/search?postalcode=${831001}&format=json`;

        try {
            const response = await fetch(apiUrl);
            const data = await response.json();
            console.log(data)
            setLocationData(data);
        } catch (error) {
            console.error('Error fetching location data:', error);
        }
    };

    useEffect(() => {
        if (831001) {
            fetchLocationData();
        }
    }, []);

    return (
        <div>
            {831001 && (
                <div>
                    <h2>Pincode</h2>
                    {locationData && locationData.length > 0 ? (
                        <div>
                            <h3>Location Information</h3>
                            <ul>
                                {locationData.map((location, index) => (
                                    <li key={index}>
                                        <strong>Address:</strong> {location.display_name}<br />
                                        <strong>Latitude:</strong> {location.lat}<br />
                                        <strong>Longitude:</strong> {location.lon}
                                    </li>
                                ))}
                            </ul>
                        </div>
                    ) : (
                        <p>No location data available for this pincode.</p>
                    )}
                </div>
            )}
        </div>
    );
}

export default PincodeLocation;
